    $("#close-btn2").click(function(){
        window.location.href=$(this).data('url')+'?id='+Math.random()

    })

    $image = $('#image')

    var avatarFlag=0
    $("#avatar").change(function(){
        if($("#avatar").val()==null){
            avatarFlag=0
            $(this).removeClass("is-valid").addClass("is-invalid").siblings(".invalid-feedback").text("");
        }else{
            avatarFlag=1;
            $(this).removeClass("is-invalid").addClass("is-valid")
            $('#avatarEdit').modal('show')
        }
        var reader = new FileReader()
        reader.addEventListener('load', function() {
            $image.prop('src', reader.result)
            $image.cropper('destroy')
            $image.cropper({
                viewMode: 1,
                aspectRatio: 1 / 1,
                initialAspectRatio: 1 / 1,
            })
        }, false);
        $('#crop-btn').removeClass('invisible')
        reader.readAsDataURL(this.files[0])
    })


