function sendEmailCode(e, time=60){
    if (time == 0) {
        e.removeAttr("disabled");
        e.text("");
        time = 60;
    } else {
        e.attr("disabled", "disabled")
        e.text("("+time+"s)");
        time--;
        setTimeout(function() {
            sendEmailCode(e, time)
        }, 1000)
    }
}
